import Socialicons from "./Social_icons";
import "./index.css";
import React, { useEffect } from "react";

function About() {
  useEffect(() => {
    const img = document.getElementById("animated-img");
    img.classList.add("animate-up");

    setTimeout(() => {
      img.classList.remove("animate-up");
    }, 1000);
  }, []);
  return (
    <div className="flex justify-center items-center flex-col ">
      <section className="main flex gap-2">
        <div className="p-3 ">
          <img
            src="https://th.bing.com/th/id/OIP.O2OxURVtfNV0CgA3-WhtZgHaEK?w=328&h=187&c=7&r=0&o=5&dpr=1.5&pid=1.7"
            alt="Avatar"
            id="animated-img"
            className="w-40 h-40 object-cover m-6 aspect-w-1 aspect-h-1 border-t-4 rounded-lg border-orange-500"
          ></img>
        </div>

        <div className="mt-8 flex flex-col">
          <h3 className="flex justify-start">HI, I'm</h3>
          <h1 className="font-bold">
            <span style={{ color: "#f9532d" }}>Naveen</span> Mandava
          </h1>
          <p>
            Professional Front-end developer, Main goal is to help and satisfy
            <br />
            the local and global clients by the web development solutions.
          </p>
          <div class="social bg-red-500 text-red-500">
            <a href="https://github.com/bikashdev01/">
              <i class="bi bi-github"></i>
            </a>
            <a href="https://t.me/web_devs_i">
              <i class="bi bi-telegram"></i>
            </a>
            <a href="https://www.linkedin.com/in/vikash-web-dev/">
              <i class="bi bi-linkedin"></i>
            </a>
            <a href="https://www.youtube.com/@Web_Devs__">
              <i class="bi bi-youtube"></i>
            </a>
          </div>
          <Socialicons />
        </div>
      </section>
    </div>
  );
}

export default About;
